<!DOCTYPE html>
<html>

<head>
    <meta charset="utf-8">
    <title></title>
    <script src="./jquery-3.6.0.min.js"></script>
    <script type="text/javascript">
    $(document).ready(function() {
        $("td").click(function(elm) {
            var td = elm.currentTarget;
            $(td).toggleClass($("#className").val());
        });
        $("#imgToggle").click(function() {
            $("img").toggleClass("trans");
            $("table").toggleClass("trans");
        });
    })
    </script>
    <style type="text/css">
    td {
        background-color: #36AEBF !important;
        border: 1px dotted gray;
        width: 3px;
        height: 3px;
    }

    img:not(.trans) {
        visibility: hidden;
    }



    table.trans {
        opacity: 0.3;
    }

    tr:nth-of-type(16n+1) td {
        border-top: 1px solid red;
    }

    tr:last-of-type td {
        border-bottom: 1px solid red;
    }

    tr td:nth-of-type(16n+1) {
        border-left: 1px solid red;
    }

    tr td:last-of-type {
        border-right: 1px solid red;
    }

    td.edge {
        background-color: #BBE90B !important;
    }

    td.one {
        background-color: #4B9F4A !important;
    }

    td.two {
        background-color: #F8BB3D !important;
    }

    td.three {
        background-color: #FF698F !important;
    }

    td.four {
        background-color: #E4CD9E !important;
    }

    td.frame {
        background-color: white !important;
    }

    td.blue {
        background-color: #00A3DA !important;
    }

    td.deepblue {
        background-color: #006CB7 !important;
    }

    img#tw_height {
        position: absolute;
        left: 39px;
        top: 80px;
        z-index: -1;
        width: 578px;
    }

    img#golden_gate {
        position: absolute;
        left: 59px;
        top: 163px;
        z-index: -1;
        width: 190px;
    }

    img#mazu {
        position: absolute;
        left: 62px;
        top: 53px;
        z-index: -1;
        width: 100px;
    }

    img#east_in {
        position: absolute;
        left: 164px;
        top: 56px;
        z-index: -1;
        width: 120px;
    }

    img#orange_light {
        position: absolute;
        left: 45px;
        top: 271px;
        z-index: -1;
        width: 160px;
    }

    img#east_sand {
        position: absolute;
        left: 53px;
        top: 725px;
        z-index: -1;
        width: 180px;
    }

    img#east_sand_large {
        position: absolute;
        left: 56px;
        top: 901px;
        z-index: -1;
        width: 460px;
    }

    #taiwan {
        position: absolute;
        left: 50px;
        top: 50px;
    }
    </style>
</head>
